import { RECEIVE_USERS, receiveUsers, getAllUsersAction } from '../actions/login'

const initialState = {};

export const login = (state = initialState, action) => {
    console.log("welcome to reducer function");
    switch (action.type) {
        case RECEIVE_USERS:
            console.log("action user in reducer", action.users)
            return {
                ...state,
                users: action.users,
            }
        default:
            console.log("default");
            return state


    }

}
